import List from "./List";

const TreeList = () => {
  const dataList = {
    1: {
      one: {
        test: {},
      },
    },
    2: {
      second: {},
    },
  };
  return (
    <div className="list">
      <h5>Checking the list view</h5>
      {Object.keys(dataList).length ? <List list={dataList} /> : ""}
    </div>
  );
};

export default TreeList;
